import logging
from datetime import datetime
from typing import List, Dict, Optional
from enum import Enum

# Logger setup
logging.basicConfig(level=logging.INFO)
logger = logging.getLogger(__name__)

# Enums
class PublishStatus(Enum):
    DRAFT = "Draft"
    PUBLISHED = "Published"
    VALIDATED = "Validated"

class ActionType(Enum):
    B = "B"
    C = "C"
    D = "D"

# Database Models
class Submission:
    def __init__(self, submission_id: str, publish_status: PublishStatus, created_by: str):
        self.submission_id = submission_id
        self.publish_status = publish_status
        self.created_by = created_by
        self.last_updated = datetime.now()

    def update_publish_status(self, new_status: PublishStatus):
        self.publish_status = new_status
        self.last_updated = datetime.now()
        logger.info(f"Submission {self.submission_id} status updated to {new_status}")

class GTASWindow:
    def __init__(self, start_time: datetime, end_time: datetime):
        self.start_time = start_time
        self.end_time = end_time

    def is_active(self) -> bool:
        now = datetime.now()
        return self.start_time <= now <= self.end_time

# Validation and Derivation Logic
class Validator:
    @staticmethod
    def validate_duns(duns: str, action_type: ActionType, registration_date: datetime) -> bool:
        if action_type in [ActionType.B, ActionType.C, ActionType.D]:
            return True  # Simplified logic; assumes SAM registration is checked elsewhere
        return False

    @staticmethod
    def validate_zip_code(zip_code: str, allow_short: bool = False) -> bool:
        if allow_short and len(zip_code) == 5:
            return True
        return len(zip_code) in [5, 10]  # Validates 5-digit or ZIP+4

